import React, { useState } from "react";
import Form from "./Components/Form";

const Test = () => {
	const [state, updateState] = useState({
		name: "Vehbi",
		red: false
	});

	const changeRed = () => {
		updateState({
			red: !state.red
		});
	};

	return (
		<div>
			<p>Test</p>
			<Form name={state.data} change={changeRed} redBar={state.red} />
		</div>
	);
};

export default Test;
